import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { FiSearch, FiFilter, FiMoreVertical, FiEye, FiTrash2, FiFolder, FiUser, FiCalendar } from 'react-icons/fi';
import LoadingSpinner from '../../components/UI/LoadingSpinner';

const ProjectsContainer = styled.div`
  padding: 2rem;
  max-width: 1400px;
  margin: 0 auto;
`;

const Header = styled.div`
  display: flex;
  justify-content: between;
  align-items: center;
  margin-bottom: 2rem;

  @media (max-width: 768px) {
    flex-direction: column;
    gap: 1rem;
    align-items: flex-start;
  }
`;

const Title = styled.h1`
  font-size: 2rem;
  font-weight: 600;
  color: ${props => props.theme.colors.text};
  margin: 0;
`;

const FiltersContainer = styled.div`
  display: flex;
  gap: 1rem;
  margin-bottom: 2rem;
  padding: 1.5rem;
  background: ${props => props.theme.colors.surface};
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: 12px;

  @media (max-width: 768px) {
    flex-direction: column;
  }
`;

const SearchInput = styled.input`
  flex: 1;
  padding: 0.75rem;
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: 8px;
  background: ${props => props.theme.colors.background};
  color: ${props => props.theme.colors.text};
  font-size: 0.875rem;

  &::placeholder {
    color: ${props => props.theme.colors.textMuted};
  }

  &:focus {
    outline: none;
    border-color: ${props => props.theme.colors.primary};
  }
`;

const FilterSelect = styled.select`
  padding: 0.75rem;
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: 8px;
  background: ${props => props.theme.colors.background};
  color: ${props => props.theme.colors.text};
  font-size: 0.875rem;
  min-width: 150px;

  &:focus {
    outline: none;
    border-color: ${props => props.theme.colors.primary};
  }
`;

const ProjectsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(350px, 1fr));
  gap: 1.5rem;
  margin-bottom: 2rem;
`;

const ProjectCard = styled.div`
  background: ${props => props.theme.colors.surface};
  border: 1px solid ${props => props.theme.colors.border};
  border-radius: 12px;
  padding: 1.5rem;
  transition: all 0.2s ease;

  &:hover {
    transform: translateY(-2px);
    box-shadow: 0 8px 25px rgba(0, 0, 0, 0.1);
  }
`;

const ProjectHeader = styled.div`
  display: flex;
  justify-content: between;
  align-items: flex-start;
  margin-bottom: 1rem;
`;

const ProjectInfo = styled.div`
  flex: 1;
`;

const ProjectName = styled.h3`
  font-size: 1.125rem;
  font-weight: 600;
  color: ${props => props.theme.colors.text};
  margin: 0 0 0.5rem 0;
  line-height: 1.3;
`;

const ProjectDescription = styled.p`
  font-size: 0.875rem;
  color: ${props => props.theme.colors.textMuted};
  margin: 0;
  line-height: 1.4;
  display: -webkit-box;
  -webkit-line-clamp: 2;
  -webkit-box-orient: vertical;
  overflow: hidden;
`;

const ProjectActions = styled.div`
  display: flex;
  gap: 0.5rem;
`;

const ActionButton = styled.button`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 32px;
  height: 32px;
  border: none;
  background: transparent;
  color: ${props => props.theme.colors.textMuted};
  border-radius: 6px;
  cursor: pointer;
  transition: all 0.2s ease;

  &:hover {
    background: ${props => props.theme.colors.border};
    color: ${props => props.theme.colors.text};
  }
`;

const ProjectMeta = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.75rem;
  margin-top: 1rem;
  padding-top: 1rem;
  border-top: 1px solid ${props => props.theme.colors.border};
`;

const MetaRow = styled.div`
  display: flex;
  align-items: center;
  gap: 0.5rem;
  font-size: 0.875rem;
  color: ${props => props.theme.colors.textMuted};
`;

const MetaIcon = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: 16px;
  height: 16px;
`;

const ProjectTypeBadge = styled.span`
  padding: 0.25rem 0.75rem;
  border-radius: 20px;
  font-size: 0.75rem;
  font-weight: 500;
  background: ${props => {
    switch (props.type) {
      case 'website': return '#059669';
      case 'figma': return '#7C3AED';
      case 'mobile': return '#DC2626';
      case 'app': return '#D97215';
      default: return '#6B7280';
    }
  }}20;
  color: ${props => {
    switch (props.type) {
      case 'website': return '#059669';
      case 'figma': return '#7C3AED';
      case 'mobile': return '#DC2626';
      case 'app': return '#D97215';
      default: return '#6B7280';
    }
  }};
`;

const StatusBadge = styled.span`
  padding: 0.25rem 0.75rem;
  border-radius: 20px;
  font-size: 0.75rem;
  font-weight: 500;
  background: ${props => {
    switch (props.status) {
      case 'active': return '#10B98120';
      case 'archived': return '#F59E0B20';
      case 'deleted': return '#EF444420';
      default: return '#6B728020';
    }
  }};
  color: ${props => {
    switch (props.status) {
      case 'active': return '#10B981';
      case 'archived': return '#F59E0B';
      case 'deleted': return '#EF4444';
      default: return '#6B7280';
    }
  }};
`;

const StatsRow = styled.div`
  display: flex;
  justify-content: between;
  align-items: center;
  margin-top: 1rem;
`;

const StatItem = styled.div`
  text-align: center;
`;

const StatValue = styled.div`
  font-size: 1.25rem;
  font-weight: 600;
  color: ${props => props.theme.colors.text};
`;

const StatLabel = styled.div`
  font-size: 0.75rem;
  color: ${props => props.theme.colors.textMuted};
`;

const AdminProjects = () => {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchTerm, setSearchTerm] = useState('');
  const [typeFilter, setTypeFilter] = useState('all');
  const [statusFilter, setStatusFilter] = useState('all');

  useEffect(() => {
    fetchProjects();
  }, [searchTerm, typeFilter, statusFilter]);

  const fetchProjects = async () => {
    try {
      setLoading(true);

      // Заглушка данных для демонстрации
      const mockProjects = [
        {
          id: 1,
          name: 'E-commerce Интернет-магазин',
          description: 'Комплексный анализ UX/UI интернет-магазина с фокусом на конверсию и пользовательский опыт',
          projectType: 'website',
          status: 'active',
          createdAt: '2024-01-15T10:00:00Z',
          user: {
            username: 'demo',
            email: 'demo@uxuilab.com',
            name: 'Демо пользователь'
          },
          analysisCount: 5,
          reportCount: 3
        },
        {
          id: 2,
          name: 'Мобильный Банкинг',
          description: 'Дизайн-система мобильного банковского приложения',
          projectType: 'mobile',
          status: 'active',
          createdAt: '2024-01-16T09:00:00Z',
          user: {
            username: 'admin',
            email: 'admin@uxuilab.com',
            name: 'Администратор'
          },
          analysisCount: 8,
          reportCount: 4
        },
        {
          id: 3,
          name: 'Образовательная платформа',
          description: 'UX/UI платформы для онлайн-обучения',
          projectType: 'website',
          status: 'archived',
          createdAt: '2024-01-10T11:00:00Z',
          user: {
            username: 'test',
            email: 'test@example.com',
            name: 'Тестовый пользователь'
          },
          analysisCount: 3,
          reportCount: 2
        },
        {
          id: 4,
          name: 'SaaS Dashboard',
          description: 'Интерфейс аналитической панели для B2B продукта',
          projectType: 'app',
          status: 'active',
          createdAt: '2024-01-12T14:00:00Z',
          user: {
            username: 'demo',
            email: 'demo@uxuilab.com',
            name: 'Демо пользователь'
          },
          analysisCount: 6,
          reportCount: 5
        },
        {
          id: 5,
          name: 'Медицинское приложение',
          description: 'Мобильное приложение для телемедицины',
          projectType: 'figma',
          status: 'active',
          createdAt: '2024-01-18T16:00:00Z',
          user: {
            username: 'admin',
            email: 'admin@uxuilab.com',
            name: 'Администратор'
          },
          analysisCount: 4,
          reportCount: 2
        }
      ];

      // Фильтрация
      let filteredProjects = mockProjects;

      if (searchTerm) {
        filteredProjects = filteredProjects.filter(project => 
          project.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
          project.description.toLowerCase().includes(searchTerm.toLowerCase()) ||
          project.user.name.toLowerCase().includes(searchTerm.toLowerCase())
        );
      }

      if (typeFilter !== 'all') {
        filteredProjects = filteredProjects.filter(project => project.projectType === typeFilter);
      }

      if (statusFilter !== 'all') {
        filteredProjects = filteredProjects.filter(project => project.status === statusFilter);
      }

      setProjects(filteredProjects);
    } catch (error) {
      console.error('Ошибка загрузки проектов:', error);
    } finally {
      setLoading(false);
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('ru-RU', {
      day: '2-digit',
      month: '2-digit',
      year: 'numeric'
    });
  };

  const getProjectTypeLabel = (type) => {
    switch (type) {
      case 'website': return 'Веб-сайт';
      case 'figma': return 'Figma';
      case 'mobile': return 'Мобильное';
      case 'app': return 'Приложение';
      default: return type;
    }
  };

  const getStatusLabel = (status) => {
    switch (status) {
      case 'active': return 'Активный';
      case 'archived': return 'Архивный';
      case 'deleted': return 'Удалён';
      default: return status;
    }
  };

  if (loading) {
    return <LoadingSpinner fullScreen />;
  }

  return (
    <ProjectsContainer>
      <Header>
        <Title>Управление проектами</Title>
      </Header>

      <FiltersContainer>
        <SearchInput
          type="text"
          placeholder="Поиск по названию, описанию или автору..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />

        <FilterSelect
          value={typeFilter}
          onChange={(e) => setTypeFilter(e.target.value)}
        >
          <option value="all">Все типы</option>
          <option value="website">Веб-сайт</option>
          <option value="figma">Figma</option>
          <option value="mobile">Мобильное</option>
          <option value="app">Приложение</option>
        </FilterSelect>

        <FilterSelect
          value={statusFilter}
          onChange={(e) => setStatusFilter(e.target.value)}
        >
          <option value="all">Все статусы</option>
          <option value="active">Активные</option>
          <option value="archived">Архивные</option>
          <option value="deleted">Удалённые</option>
        </FilterSelect>
      </FiltersContainer>

      <ProjectsGrid>
        {projects.map((project) => (
          <ProjectCard key={project.id}>
            <ProjectHeader>
              <ProjectInfo>
                <ProjectName>{project.name}</ProjectName>
                <ProjectDescription>{project.description}</ProjectDescription>
              </ProjectInfo>

              <ProjectActions>
                <ActionButton title="Просмотр">
                  <FiEye />
                </ActionButton>
                <ActionButton title="Действия">
                  <FiMoreVertical />
                </ActionButton>
              </ProjectActions>
            </ProjectHeader>

            <ProjectMeta>
              <MetaRow>
                <MetaIcon><FiUser /></MetaIcon>
                <span>{project.user.name}</span>
                <ProjectTypeBadge type={project.projectType}>
                  {getProjectTypeLabel(project.projectType)}
                </ProjectTypeBadge>
              </MetaRow>

              <MetaRow>
                <MetaIcon><FiCalendar /></MetaIcon>
                <span>{formatDate(project.createdAt)}</span>
                <StatusBadge status={project.status}>
                  {getStatusLabel(project.status)}
                </StatusBadge>
              </MetaRow>
            </ProjectMeta>

            <StatsRow>
              <StatItem>
                <StatValue>{project.analysisCount}</StatValue>
                <StatLabel>Анализов</StatLabel>
              </StatItem>
              <StatItem>
                <StatValue>{project.reportCount}</StatValue>
                <StatLabel>Отчётов</StatLabel>
              </StatItem>
            </StatsRow>
          </ProjectCard>
        ))}
      </ProjectsGrid>

      {projects.length === 0 && (
        <div style={{ textAlign: 'center', padding: '3rem', color: '#6B7280' }}>
          <FiFolder size={48} style={{ marginBottom: '1rem' }} />
          <h3>Проекты не найдены</h3>
          <p>Попробуйте изменить параметры поиска</p>
        </div>
      )}
    </ProjectsContainer>
  );
};

export default AdminProjects;
